
import base64
import zlib
import hashlib
import tempfile
import subprocess
import os
import sys
from cryptography.fernet import Fernet

#
ENCRYPTED_FILE_DATA = """"""
FILE_EXTENSION = ".py"

def main():
    #
    if len(sys.argv) > 1:
        password = sys.argv[1]
    else:
        password = input("كلمة المرور: ")
    
    try:
        #
        key_hash = hashlib.sha256(password.encode('utf-8')).digest()
        fernet_key = base64.urlsafe_b64encode(key_hash)
        cipher = Fernet(fernet_key)
        
        #
        decoded = base64.b64decode(ENCRYPTED_FILE_DATA)
        decompressed = zlib.decompress(decoded)
        decrypted_data = cipher.decrypt(decompressed)
        
        #
        with tempfile.NamedTemporaryFile(mode='wb', suffix=FILE_EXTENSION, delete=False) as f:
            f.write(decrypted_data)
            temp_file = f.name
        
        if FILE_EXTENSION == '.py':
            exec(decrypted_data.decode('utf-8'), {'__name__': '__main__'})
        elif FILE_EXTENSION in ['.js', '.mjs', '.cjs']:
            subprocess.run(['node', temp_file], check=True)
        elif FILE_EXTENSION in ['.html', '.htm']:
            import webbrowser
            webbrowser.open(f'file://{temp_file}')
        else:
            #
            try:
                print(decrypted_data.decode('utf-8'))
            except:
                print(f"تم فك تشفير الملف: {temp_file}")
        
        os.unlink(temp_file)
        
    except Exception as e:
        print("كلمة مرور خاطئة أو ملف تالف")
        sys.exit(1)

if __name__ == "__main__":
    main()
